import React from 'react'

const Item = ({ item }) => {
    return (
        <div>
            <h3>{item.company}</h3>
            <h2>{item.position}</h2>
            <hr></hr>
            <ul>
                <p>{item.role}</p>
                <p>{item.level}</p>
                <ul>
                    {item.languages.map(language => {
                        return <li>{language}</li>
                    })}
                </ul>

            </ul>

        </div>
    )
}

export default Item;
